  false,\n\t\"url\": null,\n\t\"notes\": \"This plan for Rappahannock River Valley
  National Wildlife Refuge will provide guidance on a wide range of fire management
  activities including preparedness, prescribed fire, wild land fire, and prevention
  and education activities. Values considered in this Fire Management Plan include:
  the protection of Refuge property, structures and improvements, cultural and historic
  sites, neighboring private property, endangered and threatened species of concern,
  and the enhancement of Refuge wildlife habitat.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
